import {FlightInformation} from './flightInformation';

export class Flight {
  private _flightNumber: string;
  private _origin: string;
  private _originDate: Date;
  private _destination: string;
  private _destinationDate: Date;
  private _flightInformation: FlightInformation;
  private _planeNumber: 'string';
  private _duration: number;
  private originGate
  private 

  constructor(flightNumber: string, origin: string, originDate: Date,
              destination: string, destinationDate: Date, flightInformation?: FlightInformation) {
    this.flightNumber = flightNumber;
    this.origin = origin;
    this.originDate = originDate;
    this.destination = destination;
    this.destinationDate = destinationDate;
    this.flightInformation = flightInformation;
  }

  get flightNumber(): string {
    return this._flightNumber;
  }

  set flightNumber(value: string) {
    this._flightNumber = value;
  }

  get origin(): string {
    return this._origin;
  }

  set origin(value: string) {
    this._origin = value;
  }

  get originDate(): Date {
    return this._originDate;
  }

  set originDate(value: Date) {
    this._originDate = value;
  }

  get destination(): string {
    return this._destination;
  }

  set destination(value: string) {
    this._destination = value;
  }

  get destinationDate(): Date {
    return this._destinationDate;
  }

  set destinationDate(value: Date) {
    this._destinationDate = value;
  }

  get flightInformation(): FlightInformation {
    return this._flightInformation;
  }

  set flightInformation(value: FlightInformation) {
    this._flightInformation = value;
  }
}
